import React from 'react'
import './style.css'

import RecipientCard from '../RecipientCard';

export default function RecipientList() {
  return (
    <div className='recipient-list'>
      <RecipientCard />
      <RecipientCard />
      <RecipientCard />
    </div>
  )
}
